    value: Determination of usual and normal charges for Enhanced Online Voter File
      Access for payments received on Schedule A, Line 17 of the Committees report
      was calculated by the total cost of developing and hosting our online voter
      file and dividing it by the number of records within the file as well as the
      presumed number of overall users.  The cost to the organization is then determined
      by the number of records requested and the length of time access will be granted.  i.e.
      Statewide or congressional charges are based on the number of records in the
      district or entire state as requested.  -  Please note that employees of the
